import React, { Component } from 'react'

export default class Recipe extends Component {
  render() {
    return (
      <>
        {this.props.Recipes.map(val => 
          <div className='col-md-4 my-3'>
            <img src={val.image_url} className="w-100" height='' />
              <h4>{val.title}</h4>
          </div>

        
        )}
      </>
    )
  }
}
